mcl3dEngine.getPixelPos = function(point, object){
	var x = (object.position.x)-(point[0]+object.position.x);
	var y = (object.position.y)-(point[1]+object.position.y);
	var z = (object.position.z)-(point[2]+object.position.z);

	var z2 = z;
	var y2 = y;
	var x2 = x;

	var newChildPos = mcl3dEngine.getPosRelativelyTo([x2, y2, z2], [object.rotation.x, object.rotation.y, object.rotation.z]);
	x2 = newChildPos[0];
	y2 = newChildPos[1];
	z2 = newChildPos[2];

	x2 += object.position.x;
	y2 += -object.position.y + 250;
	z2 += object.position.z;

	var fX = new Number(x2);
	var fY = new Number(y2 - 250);
	var fZ = new Number(z2);

	//x2 += mcl3dEngine.mainCamera.position.x;
	//y2 -= mcl3dEngine.mainCamera.position.y;
	//z2 += mcl3dEngine.mainCamera.position.z;
	x2 += mcl3dEngine.mainCamera.position.x - 250;
	y2 += mcl3dEngine.mainCamera.position.y - 250;
	z2 -= mcl3dEngine.mainCamera.position.z - 200;
	
	var fakeX = x2;
	var fakeY = y2;
	var fakeZ = z2;

	//Rotation on axis Y (Cam)
	var dXZ = Math.sqrt(Math.pow(fakeX,2) + Math.pow(fakeZ,2));
	var ang = Math.acos(fakeX/dXZ) * (fakeZ>0 ? -1 : 1) + Math.PI/2;
	if(isNaN(ang)){
		ang = 0;
	}
	fakeZ = dXZ * Math.cos(-mcl3dEngine.mainCamera.rotation.y+ang);
	fakeX = dXZ * Math.sin(-mcl3dEngine.mainCamera.rotation.y+ang);

	//Rotation on axis X (Cam)
	var dZY = Math.sqrt(Math.pow(fakeZ,2) + Math.pow(fakeY,2));
	var ang3 = Math.acos(fakeY/dZY) * (fakeZ>0 ? -1 : 1);
	if(isNaN(ang3)){
		ang3 = 0;
	}
	fakeY = dZY * Math.cos(-mcl3dEngine.mainCamera.rotation.x+ang3);
	fakeZ = dZY * Math.sin(-mcl3dEngine.mainCamera.rotation.x+ang3);

	x2 = fakeX + mcl3dEngine.resolution.x / 2;
	y2 = fakeY + mcl3dEngine.resolution.y / 2;
	z2 = fakeZ + 200;

	//console.log(z2);
	var oldz2 = z2;
	//if(z2 > 199) z2 = 199;
	//testingText3 = z2;
	//testingText4 = 200/(z2/100);
	z2 = 200-z2;
	z2 = 200/(z2/100);
	//z2 = (z2<0 ? 0 : z2);
	z2 *= 2;
	z2 -= 200;

	if(oldz2 < 200){
		return [(x2+((x2-mcl3dEngine.resolution.x/2)/(3000/(z2*5))*3))*mcl3dEngine.mainCamera.persp-mcl3dEngine.resolution.x*(-0.5+0.5*mcl3dEngine.mainCamera.persp), (y2+((y2-mcl3dEngine.resolution.y/2)/(3000/(z2*5))*3))*mcl3dEngine.mainCamera.persp-mcl3dEngine.resolution.y*(-0.5+0.5*mcl3dEngine.mainCamera.persp), fX, fY, fZ];
	}
	else{
		return [false, x2+((x2-mcl3dEngine.resolution.x/2)/(3000/(z2*5))*3), y2+((y2-mcl3dEngine.resolution.y/2)/(3000/(z2*5))*3), fX, fY, fZ];
	}
}

mcl3dEngine.drawPixel = function(img, x, y, r, g, b, a)
{
	if(x >= 0 && x < mcl3dEngine.resolution.x)
	{
		//var index = (y * mcl3dEngine.resolution.x + x) * 4;
		var pixel = img[y][x];
		if(r <= 255)
			pixel[0] = r;
		else
			pixel[0] = 255;

		if(g <= 255)
			pixel[1] = g;
		else
			pixel[1] = 255;

		if(b <= 255)
			pixel[2] = b;
		else
			pixel[2] = 255;
		//img.data[index + 3] = a;
	}
}

mcl3dEngine.getPosRelativelyTo = function(childPos, parentRot){
	var newChildPos = [...childPos];

	//Rotation on axis Y
	var dXZ = Math.sqrt(Math.pow(newChildPos[0], 2) + Math.pow(newChildPos[2], 2));
	var ang = Math.acos(newChildPos[0]/dXZ) * (newChildPos[2]>0 ? -1 : 1);
	if(isNaN(ang)){
		ang = 0;
	}
	newChildPos[2] = dXZ * Math.sin(parentRot[1] + ang);
	newChildPos[0] = dXZ * Math.cos(parentRot[1] + ang);

	//Rotation on axis Z
	var dXY = Math.sqrt(Math.pow(newChildPos[0], 2) + Math.pow(newChildPos[1], 2));
	var ang2 = Math.acos(newChildPos[1] /dXY) * (newChildPos[0] >0 ? -1 : 1);
	if(isNaN(ang2)){
		ang2 = 0;
	}
	newChildPos[1] = dXY * Math.cos(parentRot[2] + ang2);
	newChildPos[0] = dXY * Math.sin(parentRot[2] + ang2);

	//Rotation on axis X
	var dZY = Math.sqrt(Math.pow(newChildPos[2], 2) + Math.pow(newChildPos[1], 2));
	var ang3 = Math.acos(newChildPos[1]/dZY) * (newChildPos[2]>0 ? -1 : 1);
	if(isNaN(ang3)){
		ang3 = 0;
	}
	newChildPos[1] = dZY * Math.cos(parentRot[0] + ang3);
	newChildPos[2] = dZY * Math.sin(parentRot[0] + ang3);

	return newChildPos;
}

